import styled from "styled-components";

export const Container = styled.header` 
    display: flex;
    justify-content: center;
    min-height: 50px !important;
    max-height: 300px;
    position: relative;
`;

export const Content = styled.div`
    position: absolute;
    left: 10%;
    top: 10%;
`;
